using Plugin.Media;
using Plugin.Media.Abstractions;
using Prism.Commands;
using Prism.Mvvm;
using Prism.Navigation;
using Prism.Services;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using System.Windows.Input;
using TheCoffeHouse.Services;
using TheCoffeHouse.ViewModels.Base;
using Xamarin.Forms;

namespace TheCoffeHouse.ViewModels
{
    public class AdminPageViewModel : BaseViewModel
    {
        public AdminPageViewModel(INavigationService navigationService = null,
            IPageDialogService dialogService = null,
            IHttpService httpService = null,
            ISQLiteService sQLiteService = null) : base(navigationService, dialogService, httpService, sQLiteService)
        {
            PickImageCommand = new DelegateCommand(async () => await PickImageExecute());
            Image = ConvertFromBase64("");
        }


        #region Properties
        private ImageSource _image;

        public ImageSource Image
        {
            get { return _image; }
            set
            {
                SetProperty(ref _image, value);
            }
        }
        #endregion

        #region PickImageCommand

        public ICommand PickImageCommand { get; set; }
        public async Task PickImageExecute()
        {
            await CheckNotBusy(async () =>
            {
                var mediafile = await PickPhoto();
                var x = await ConvertToBase64(mediafile);
            });
        }

        async Task<MediaFile> PickPhoto()
        {
            var file = await CrossMedia.Current.PickPhotoAsync(new Plugin.Media.Abstractions.PickMediaOptions
            {
                CompressionQuality = 80,
                PhotoSize = PhotoSize.Medium,
                SaveMetaData = true,
            });

            return file;
        }

        #endregion

        #region TakeImageCommand


        public async Task TakeImageExecute()
        {
            await CheckNotBusy(async () =>
            {
                var mediafile = await TakePhoto();
                UpdateImage(mediafile);
            });
        }

        async Task<MediaFile> TakePhoto()
        {
            await CrossMedia.Current.Initialize();

            var imageFile = await CrossMedia.Current.TakePhotoAsync(new Plugin.Media.Abstractions.StoreCameraMediaOptions
            {
                Directory = "TheCoffeHouse.Images",
                Name = DateTime.Now.Ticks.ToString(),
                CompressionQuality = 80,
                DefaultCamera = CameraDevice.Front,
                PhotoSize = PhotoSize.Medium,
                SaveToAlbum = true,
                SaveMetaData = true,
            });



            return imageFile;
        }

        #endregion

        #region UpdateImage

        private async void UpdateImage(MediaFile mediafile)
        {
        }
        #endregion
    }
}
